    Subscribe {
            id: String,
            query: Query,
            subscription_tx: SubscriptionTx,
            result_tx: ChannelTx<Result<(), Error>>,
        },
    Unsubscribe {
            query: Query,
            result_tx: ChannelTx<Result<(), Error>>,
        },
    Publish(Box<Event>),
    Terminate,
}

enum EventData {
    NewBlock {
            block: Option<Block>,
            result_begin_block: Option<BeginBlock>,
            result_end_block: Option<EndBlock>,
        },
    Tx {
            tx_result: TxInfo,
        },
    GenericJsonEvent(serde_json::Value),
}

